import React from "react";

export const MovieInfo = ({ movie }) => {
  return (
    <>
      <div>
        <h1>{ movie.title }</h1>
        <h2>{movie.tagline}</h2>
        <p>{movie.overview}</p>
      </div>
    </>
  );
};
